import React from 'react';
import {Container, Content} from './styles';

interface Props {
    variant: 'blue' | 'beige' | 'white' | 'black';
    title: string;
    description: string;
}


const Section: React.FC<Props> = ({ title, description}) => {
    return (
        <Container className={{variant}}>
            <Content>
                <h2>{title}</h2>
                <p>{description}</p>
            </Content>
        </Container>
    )
};
export default Section;
